import { Component } from '@angular/core';
import { User } from "../../model";
import { NavController, NavParams, AlertController, ModalController } from 'ionic-angular';
import { DBClient } from "../../services/db-client";
import { BussinessClient } from "../../services/business-service";
import { AppVersion } from 'ionic-native';
import { Login } from "../login";
import { LogView } from "../log";
@Component({
	selector: 'settings',
	templateUrl: 'settings.html'
})
export class Settings {

	settings: any = {};
	user: User = <any>{};
	shouldSave: boolean = false;
	version: string;

	constructor(private navCtrl: NavController,
		private navParams: NavParams,
		private db: DBClient,
		private client: BussinessClient,
		private alertCtrl: AlertController,
		private modalCtrl: ModalController) {
		AppVersion.getVersionNumber().then((version) => {
			this.version = version;
		});
	}

	ionViewWillEnter() {
		this.db.getAllConfig().subscribe(settings => {
			this.settings = settings;
			this.db.getRegistration().subscribe(user => {
				this.user = user;
				this.shouldSave = false;
			});
		});

	}

	showLogs(){
		let modal = this.modalCtrl.create(LogView);
		modal.present();
	}

	onChange() {
		this.shouldSave = true;
	}

	saveSettings() {
		this.db.saveConfig("autoUpload", this.settings.autoUpload).subscribe(() => {
			this.db.saveConfig("enableLogging", this.settings.enableLogging).subscribe(() => {
				this.shouldSave = false;
			});
		});
	}

	sync() {
		this.client.getUpdates().subscribe(()=> {});
	}

	recognize(){
		//data:image/png;base64,
		let img = "";
		let ctrl = this.alertCtrl;
		window["TesseractPlugin"] && TesseractPlugin.recognizeText(img, "eng", function(recognizedText) {
					let alert = ctrl.create({
						title: "Tesseract OCR",
						message: "<pre>" + recognizedText + "</pre>"
					});
					alert.present();
				}, function(reason) {
					console.error( reason);
				});
	}

	unauthenticate() {
		let confirm = this.alertCtrl.create({
			title: 'Unauthenticate?',
			message: 'Are you sure you want to unauthenticate this device?',
			buttons: [
				{
					text: 'Cancel',
					handler: () => {
					}
				},
				{
					text: 'Unauthenticate',
					handler: () => {
						this.client.unregister(this.user).subscribe(()=>{
							this.user = <any>{};
							setTimeout(()=>{
								this.navCtrl.setRoot(Login);
							}, 300);
						});
					}
				}
			]
		});
		confirm.present();
	}
}
